import React from "react";

import { Box, Container, Grid, List } from "@mui/material";
import { styled } from "@mui/material";

const Niti = styled("div")(({ theme }) => ({
  fontFfamily: "Times",
  fontSize: "36px",
  fontWeight: 400,
  lineHeight: "36px",
  letterSpacing: "0em",
  textAlign: "left",

  [theme.breakpoints.down("sm")]: {
    fontSize: "30px",
    fontWeight: 400,
    letterSpacing: "0em",
    textAlign: "center",
  },
}));

function Home() {
  return (
    <>
      <Box></Box>
    </>
  );
}

export default Home;
